import Dico from "./dico";
import emojipedia from "../emojipedia";

function CreateDico(emojiDico){
  return (
    <div>
      <Dico />
    </div>
  )
}

function App() {
  return (
    <Dico 
      key={emojipedia[0].id}
      emoji={emojipedia[0].emoji}
      name={emojipedia[0].name}
      meaning={emojipedia[0].meaning}
    />
  );
}

export default App;
